import React from "react";

export const Member = (props) => {
  return (
    <div className="member">
      <h5>member component</h5>
    {props.member._id} <br />
    {props.member.firstName} <br />
    {props.member.lastName} <br />
    {props.member.email} <br/>
    <button> Edit </button> 
    <hr />
    </div>
  )
}
